int test_hess(double * theta){

  double absV = fabs(theta[NINPUT]);

  matrix<double,3,3> M = hessian(theta);

  for(int l = 0; l < 3; l++)
    for(int m = 0; m < 3; m++) 
      if( isnan(M(l,m)) || isinf(M(l,m)) ) return 0; 



  //  cout << csv << M << endl; 
  matrix<double,3,1> ev = real_eigenvalues( M ); 
  matrix<double,3,1> dr = derivative(theta);

  //  cout << csv << ev << endl;
  //  cout << csv << dr << endl; 
  
  for(int j = 0; j < 3; j++) {
    //    printf(" dr(%d) = %e  ", j, dr(j)); 
    if( fabs(dr(j)) > absV  ) return 0;
  }
  //  printf(" %e \n", absV);
    
  for(int l = 0; l < 3; l++){
    //    for(int m = 0; m < 2; m++) 
    //      if( fabs(dr(l)) > fabs(ev(m)) && fabs(ev(m)) !=0  ) return 0;
    if( (fabs(dr(l)) > fabs(ev(l))) && fabs(ev(l)) !=0  ) return 0; 
  }

    return 1;
}





